import React from 'react'

export default function DialogElement({ secondUsername, lastMessage, lastDate }) {
    return (
        <>
            <div className="chat-list--name-message">
                <p>{secondUsername}</p>
                <small className="hint">{lastMessage ?? 'no messages yet'}</small>
            </div>
            <time className="hint">{lastDate}</time>
        </>
    )
}
